import './App.scss';
import WeitherCard from './components/weitherCard';


function App() {
  let days = [
    {
      temp : '25C',
      time : 'Morning'
    },
    {
      temp : '10C',
      time : 'Night'
    },
    {
      temp : '5C',
      time : 'Evening'
    },
    {
      temp : '15C',
    },
  ]

  return (
    <div className="App">
      {days.map((data, key) => <WeitherCard key={key} temp={data.temp} clima={data.time}/>)}
    </div>
  );
}

export default App;
